Check out the wild I ❤️ Beer & Taco Festival! @iheartbeerca 

This was such a fun, and entertaining festival with so many incredible beer, taco, empanada ,and cocktail vendors! Plus with all the games and great music by @byrequestentertainment we felt like we were in one big, great energy bar!

Shout out to:
@leftfieldbrewery for the first beer!
@rebozostaqueria for the tacos!
@realempanadaco for the empanadas!
@pigandchickorean for the Korean tacos!
@thebakerslab for the insanely delicious cookies!
@junction56distillery for the amazing vodka cocktail!
@craft.papi for the addicting mojitos!
@rougeriverbrewery for the marshmallow beer called Moo Moo!

Check it out as they could be making their way to your city next!
